(11, 'Carrie', 'The story of misfit high-school girl, Carrie White, who gradually discovers that she has telekinetic powers. Repressed by a domineering, ultra-religious mother and tormented by her peers at school, her efforts to fit in lead to a dramatic confrontation during the senior prom. ', 6, NULL, NULL, 6, '1616161616161', 3, , 1, NULL, NULL, 12);
